(56, 'Tôm Sú', 4, 1, 'img\\product\\1649393146.jpg', 'img/product/test/M1nsmWEdmCSQCxbYZwAykkVE3mEVHbcmI7Fb5WN2.webp img/product/test/ZPh81GVfsZO42iZeMJ3dMvKDLhPO4D6okg6XIDR6.webp ', '<p><strong>Tôm sú </strong>được nuôi thâm canh trong các hồ ở vùng miền tây ở Bến Tre, Bạc Liêu&nbsp;...Tôm nuôi trong môi trường tự nhiên và cho ăn thực phẩm sạch nên thịt tôm rất ngọt và săn chắc.</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2657307275670_a1b029cc1dbf4228083ae55373d84996_ed3a97af06b04d0cb0b65fcb626d5bab_grande.jpg\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/1bcedf0bc6963dc86487_391156c709a245128f0d421e622bee81_grande.png\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/tom-1_grande.png\" alt=\"Tôm sú sống\"></p><p><i>Tôm sú &nbsp;có nhiều loại : sọc xanh, sọc đỏ...loại nào cũng ngon và chất lượng như nhau</i></p><p>Thịt tôm sú&nbsp;ngọt và săn chắc, đầu tôm ăn thơm, béo thích hợp với nhiều món cơm ngon.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/49542348_1351707338304885_1612550934481600512_o_d5ac363384344a1898c2b8badbe2de72_grande.png\"></p><p>Một số món ăn ngon từ<strong> Tôm Sú</strong></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/83085950_886238091835666_8290116076256100352_n__1__c379353027eb4e1887cac7154a92bda7_grande.png\"></p><p>&nbsp;</p><p>Tôm sú nướng vừa nhanh vừa đơn giản. Nướng xong ăn nóng liền mới ngon</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/22339027_802858143172306_5382233461436485208_o_6b4a5f6f36b544b7969367bab003f8cf_grande.png\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/grilled-prawns_grande.jpg\" alt=\"Tôm sú \"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/71204532_2462396137339086_729511602658738176_o_6fd571c1e63e4b1fa1337076f3434f79_grande.png\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/56526749_1752959101516