(57, 'Tôm Thẻ Tươi', 4, 2, 'img\\product\\1649393015.webp', 'img/product/test/7sqFKA1OSoaI2hzNsn9xB3vBQ9gjkZIz1vZEr3Ll.webp img/product/test/yVl5BnrW8Nt7Mcw0RlXqshfwuMYdsIddLimfl2Tf.webp ', '<p><strong>Tôm thẻ tươi</strong>&nbsp;giá tốt nhập mới mỗi ngày, đóng gói theo túi&nbsp;lưới&nbsp;500gram. Bảo quản điều kiện mát tôm luôn tươi ngon và chất lượng nhất.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2634271839169_ff77f96dc244dab90ba3b344aaa8a895_2c1fffdb5a6b4a0892fa5914b42d4bf1_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/dsc03572_29a3d42446c64626b687523d7ec3b1c1_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/dsc03570_e48b4654c4854910ac2477509bc187d3_grande.jpg\"></p><p>Một vài món ăn ngon được chế biến từ tôm thẻ tươi</p><p><strong>Tôm thẻ tươi</strong>&nbsp;rim mặn</p><p><img src=\"https://file.hstatic.net/1000030244/file/v60350013_2291495057730054_398307561859710976_n_d6f3db4fb49c4417a3b58e26db0433a8_grande.jpg\"></p><p>Chế biến nhanh với mì tôm cực kỳ tiện lợi</p><p><img src=\"https://file.hstatic.net/1000030244/file/v49002958_2213220819001244_4128592035458318336_n_d06494f0b9a441d390a55ec8d1b5f768_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/v50163258_2217378595141701_6915984428552421376_n_1393251cb8374bd6b569864c5e1e0a2f_grande.jpg\"></p><p>Tôm thẻ tươi nấu canh bầu, bí hoặc rau&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/v60269950_2291495027730057_8544277758203658240_n_791e7c729bc44ba3ba6b076b177a0ce4_grande.jpg\"></p>', 1, 57),
(58, 'Tôm Tít Size L', 4, 3, 'img\\product\\1649392978.webp', 'img/product/test/rCzosbjTR0j2hXreOWu7Z7HHExeig6AQLxUVGJ0d.webp img/product/test/GHeBvKgXixA0hcR9JtiQ9ys45bRAt3epGiTCbn6R.webp ', '<p>Thịt Tôm Tít Size L</p><p>Tôm tít còn gọi là bề bề ,có hình dáng thon dai và nhiều chân đầy gai, thuộc trong nhóm tôm ăn ngon và bán chạy nhất . Trong những tháng qua , sản phẩm này đang bán chạy tại shop với số lượng nhiều qua bán ra rất nhanh . Vì thịt tôm tít tử Đảo Hải Sản luôn cam kết chất lượng đưa lên hàng đầu , an tòa và hợp vệ sinh.</p><p><img src=\"https://file.hstatic.net/1000030244/file/5_4227ebdf2c47464e8519032a886e1add_grande.jpg\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/be-be-5-600x423_grande.jpg\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/fgghjj_grande.png\" alt=\"Thịt tôm tít\"></p><p>&nbsp;</p><p>Để làm ra sản phẩm thịt tôm tít trải qua nhiều quy trình, nhiều công đoạn kiểm tra chặt chẽ.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/review-chuyen-di-da-nang-4-ngay-3-dem-5_grande.png\"></p><p>&nbsp;</p><p>Tôm size khoảng ngón tay giữa&nbsp; chắc, tươi và ngọt thịt. Để bóc từng con tôm tít cũng không phải dễ dàng. Ban đầu là quy trình lựa tôm sống yếu đem lên hấp . Sau đó là qua khâu cắt dọc chân đầy gai ở 2 bên hông . Quan trọng hơn là bước cuối cùng , gỡ nhẹ từng lớp vỏ để thịt tôm tít còn nguyên vẹn, bỏ đầu , bỏ đuôi và cho vào đóng gói.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/hmjffffffffffffff_grande.png\" alt=\"Thịt tôm tít\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/31680759_653744888350912_1599143605656616960_n_grande.png\"></p><p>&nbsp;</p><p><strong>Thịt tôm tít</strong> size lớn bán chạy vì thịt tôm to ăn nhiều không thấy ngán . Từng sớ thịt săn dai và thơm lan tỏa . Tôm tít có độ ngọt và béo ăn một lần vẫn muốn ăn lần nữa.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/22688668_806425206204347_8656202418873420503_n_grande.png\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/aaaaaaa_5f961d1ee2fb4ea68d6494be1a89c383_grande.png\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/fghjjkkkk_grande.png\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/dsaaaaa_73f2264d22c24fb596ea2ba203307f41_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/asdfgghhjj_grande.png\" alt=\"Thịt tôm tít \"></p><p>&nbsp;</p><p>Thịt tôm tít nấu bún vị đậm đà , nước lèo ngọt lịm kết hợp với nhiều loại hải sản tươi ngon làm món ăn thêm phần hấp dẫn.</p><p><img src=\"https://file.hstatic.net/1000030244/file/33853515_965399750251477_358461973433679872_n_grande.jpg\"></p><p>&nbsp;</p><p>Thịt tôm tít nấu bánh canh ngọt nước, thay đổi khẩu vị để món ăn thêm phẩn hấp dẫn.&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/29186435_1924175647912826_5146306203047031331_n_grande.png\"></p><p>&nbsp;</p><p>Hoặc đơn giản hơn là nấu với mì tôm cũng ngon , thơm vài lát chanh và ớt nữa bảo đảm sẽ hấp dẫn từ hương thơm đến vị nước chua cay.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/ghjkkkhg_grande.png\" alt=\"Thịt tôm tít \"></p><p><strong>Thịt tôm tít</strong> xào sate thơm ngon và se cay , cắn từng con vừa cảm nhận độ ngọt và gia vị thấm đều vào bên trong hấp dẫn .</p><p><img src=\"https://file.hstatic.net/1000030244/file/acbn_grande.png\" alt=\"Thịt tôm tít \"></p><p><strong>Thịt tôm tít</strong> hấp rưới thêm hành và tỏi phi lên trên chấm kèm muối chanh ngon tuyệt vời không cưỡng lại nổi. Hấp dẫn bởi hương thơm và khi thưởng thức là từng sớ thịt săn dai ngọt lịm.</p><p><img src=\"https://file.hstatic.net/1000030244/file/32805379_2054388918107337_7021529556179746816_o_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/11_8cc436bc989944cb844991c3787755a1_grande.jpg\" alt=\"thịt tôm tít size L\"></p><p>&nbsp;</p><p>Tôm tít xóc tỏi cũng là món ngon nhiều khách biết đến hiện nay, thịt hợp cho nhiều buổi cơm gia đình.&nbsp;Thịt tôm tít chiên giòn trẻ em rất thịt , lớp vỏ vàng giòn rụm nhưng bên trong thịt tôm mềm và săn. Và còn nhiều món ngon khác , các chị nội trợ lưu món ăn vào để về chế biến.</p>', 1, 58),
(59, 'Tôm Khô', 4, 4, 'img\\product\\1649392831.webp', 'img/product/test/TYbfhyAkxyW5pg7cHJi0NIFDKSVRpmSGhan7HVqO.webp img/product/test/Mm3b388bARfUOSQmurezC0R4y9auY3THHWH66XOH.webp ', '<h2><strong>Tôm Khô Tiện Lợi</strong></h2><p>Tôm khô tiện lợi dễ dùng dễ bảo quản, thích hợp chế biến với nhiều món khác nhau.</p><p><img src=\"https://file.hstatic.net/1000030244/file/4_733986e5b5414835b564b01b2f759518_grande.jpg\" alt=\"tôm khô\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/zv2503825569730_15a4620166fb68102ed1e07a0385e91b_3163f125e493441cb2a2312698792069_grande.jpg\" alt=\"tom-kho\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z2503825395422_a5v0e89c4bc75f0c178e9c54b1812c17c_b56a599efc0f4a66a7d802106911d60f_grande.jpg\" alt=\"tom-kho\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z2503825329831_c7c9a7d0b9d90019a70b89835755790d_ef5a770fa982442aa74fe2adea0d06d4_grande.jpg\" alt=\"tom-kho\"></p><p>&nbsp;</p><p>Gợi ý một số món ăn phổ biến từ tôm khô</p><p><img src=\"https://file.hstatic.net/1000030244/file/18300105_412017335v849257_1249348932060839936_n_47d887fd275a46bc92329e4f82e7c086_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/1c4677492_1753313488253017_8984084689941692416_n_7da86ef38a7f4b7f8daa5de44edda1ef_grande.jpg\"></p><p>Tôm khô trộn gỏi xoài</p><p><br><img src=\"https://file.hstatic.net/1000030244/file/1587v5906_384369435262163_2832382317253623808_n_28cfb69e358d4085a081144f4f7a4f1c_grande.jpg\"></p><p>Tôm khô muối chua ngọt</p><p><img src=\"https://file.hstatic.net/1000030244/file/130966685_11599953c27752837_8228706118083178751_n_9d08a1a4630347ba9c582a5ac6dc0d4c_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/78950893_776023596199103_1679032469811756224_n_86b2e34ac8154df49652a531e59f8509_grande.jpg\"></p><p>Tôm khô nấu canh rau củ</p><p><img src=\"https://file.hstatic.net/1000030244/file/66424100_3355932v44054018_5728972917561303861_n_b6454bcc80b94aa3be024946dcb37090_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/18580539_1848702485381111_3683451566087471104_n_fbdc65a8d0e44601933415e1d1a13c13_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/42930368_349337632503949_1282722306895656830_n_8e8a5be192784c8b835cd92150e3ed83_grande.jpg\"></p><p>Chế biến nhanh với món cơm chiên, cơm trộn hoặc rim mặn</p>', 1, 59);
INSERT INTO `product` (`id`, `pro_name`, `pro_category_id`, `supplier_id`, `pro_avatar`, `pro_detail_images`, `pro_content`, `pro_status`, `pro_description_id`) VALUES
(60, 'Tôm Sú Biển', 4, 5, 'img\\product\\1649392798.webp', 'img/product/test/vRPZomZdY3HdWPtBk8DQsLOb9eCEYSfzt7RRV4wj.jpg img/product/test/NPafX5GwUECk7LYh0moQnan2V4DkHAYpW5seZsuM.webp ', '<p><strong>Tôm sú biển</strong> tự nhiên là loài tôm sú lớn sống ở vùng khơi xa và được đánh bắt trực tiếp tại Nha Trang nên nguồn cung với số lượng không nhiều. Sau khi đánh bắt về vẫn còn sống nhưng trên đường vận chuyển nhiều con sẽ yếu và mới ngất được cho vào đá ướp lạnh tươi (thường được gọi là&nbsp;<strong>tôm sú biển đông lạnh</strong>)&nbsp;khi ăn vẫn ngon hơn rất nhiều so với tôm sú nuôi.</p><p><img src=\"https://file.hstatic.net/1000030244/file/12717784_470166899774767_8217113451095729757_nhhhhhh_grande.png\" alt=\"Tôm sú biển\"></p><p><strong>Tôm sú là tôm sông hay biển?</strong></p><p>Tôm sú hiện nay đang được khai thác theo hai hình thức chính, gồm:</p><ul><li>Đánh bắt ngoài vùng biển</li><li>Chăn nuôi và khai thác theo hệ thống</li></ul><p><strong>Để phân biệt tôm sú biển và tôm sú nuôi, thì Khách yêu tham khảo các lưu ý sau:</strong></p><ul><li>Tôm sú nuôi có giá thành thấp hơn tôm sú biển từ 15-20%</li><li>Tôm nuôi thường sẽ có màu xanh thay vì màu bạc như tôm sú biển</li><li>Vỏ tôm sú nuôi sẽ mềm hơn</li></ul><p>Tôm sú biển size to , khoang 12-15con/kg , ước lượng bằng khoảng 1 ngón tay cái&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/asd_grande.png\" alt=\"Tôm sú biển\"></p><p>Mỗi lần là nhiều loại tôm sú biển khác nhau, khách nhin kĩ có thể là tôm sú màu hơi đỏ, tôm sú có đường vằn trắng .......</p><p><img src=\"https://file.hstatic.net/1000030244/file/941028_1733994936831221_8630815308075366805_n_grande.png\" alt=\"Tôm sú biển\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/jjjjjjj_grande.png\" alt=\"Tôm sú biển\"></p><p><strong>Tôm sú biển</strong> nhiều chất dinh dưỡng, rất ngon, thịt săn chắc, dễ chế biến và mang hương thơm đậm đà đặc trưng của biển. Là món hải sản được ưa thích tại các nhà hàng.</p><p><img src=\"https://file.hstatic.net/1000030244/file/fghh_9d1db8e776f5471a91ff47d7c6e1f42f_grande.png\" alt=\"Tôm sú biển\"></p>', 1, 60),
(61, 'Mực Nang', 5, 1, 'img\\product\\1649392485.webp', '', '1 con 1 Kg', 1, 61),
(62, 'Mực Ghim', 5, 2, 'img\\product\\1649392451.webp', 'img/product/test/rtYTVcT2BBOj4wvBHiAy63MDPhQHp1SErmQsRKC1.webp img/product/test/3pwuvnGWSYgmkzEAKFtQ7xrAe5Mxz0FGWRVG7Ihh.webp ', 'Khay 500g', 1, 62),
(63, 'Mực Ống Trứng', 5, 3, 'img\\product\\1649392327.webp', 'img/product/test/RKkS2Q459ilulPBSZuWGNytIRdq0eVY2ia3pWSsp.webp img/product/test/AT4vvjynjeH2yreKa0P3Hk0sIAuPQ3nXBSsSbt8o.webp ', '<h2><strong>Mực Ống Trứng</strong></h2><p><strong>Mực Ống Trứng&nbsp;</strong>&nbsp;béo ngậy, tươi ngon, trứng đầy ắp 100% ăn bùi béo. Thịt&nbsp;<strong>mực trứng</strong>&nbsp;săn chắc đến từng sớ thịt càng nhai càng ngọt.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/z1973641464265_87011858b1e8309456c9068ec1c42d80__4__3c23b6fa132244f5ade45dbc00737e14_grande.png\"></p><p>Mực trứng thuộc top hải sản giàu dinh dưỡng và phù hợp với nhiều lứa tuổi.&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/z1973641464265_87011858b1e8309456c9068ec1c42d80_7bd395d9b30e4f689de9c355db010fdb_grande.png\"></p><p>Khách mua&nbsp;<strong>mực trứng</strong>&nbsp;về rã đông sau đó rửa sơ qua nước và bắt đầu chế biến. Nên ăn nguyên con mới ngon. Ăn&nbsp;kèm rau sống và 1 chén nước chấm muối xanh hay mắm tỏi sẽ đậm đà hơn<br>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/z1973641464265_87011858b1e8309456c9068ec1c42d80__3__f8324e4726254c569aea0223e63d9e6e_grande.png\"></p><p>Mực trứng ngon nhất khi chế biến mực xào, mực hấp sả, mực chiên giòn, mực ram mặn, mực nướng</p><p><img src=\"https://file.hstatic.net/1000030244/file/z1973641464265_87011858b1e8309456c9068ec1c42d80__7__3571de34e0ea44b0b45dc23a968c4d26_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/c9cb82b6ea52100c4943_1db20fd397a4465a915805b0cb625fad_grande.png\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/z1973641464265_87011858b1e8309456c9068ec1c42d80__8__4114052ec98a421eae0e4cb693ca000f_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/93854657_541594206540017_6875806031700557824_n_ceee33f5448146748fe0ffe051b8534e_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/96083243_1315338988657554_488925255771881472_n_ad7d5a154c4e4afbbbcd475d5bf9c0ea_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/94504674_876916986158273_8142258322397986816_n_b2bb0cc6b50049ef9881ed55fee4574c_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z1973641464265_87011858b1e8309456c9068ec1c42d80__9___1__2eef610e764a448bb7b854d8fd9e0155_grande.png\"></p>', 1, 63),
(64, 'Mực Khô', 5, 4, 'img\\product\\1649392180.webp', 'img/product/test/Ee2GWuysfAUrfJU4DJHG2qoI31QrU4FRiBQIcBXS.webp img/product/test/ah8RbUHtlkRHqrTZAisnx7lSw0c72XGLZM6Klgck.webp ', '<p><strong>Mực Khô Miền Trung Ngon &amp; Chất Lượng</strong></p><p>Size 18&nbsp;- 20&nbsp;con/kg hút chân không tiện lợi</p><p><img src=\"https://file.hstatic.net/1000030244/file/muc__1__3316428137cb4a8e9a052f864ee98d15_grande.png\"></p><p><strong>Mực khô</strong> được làm từ những con mực ống mới câu lên làm sạch và xẻ phơi tại biển. Phơi nhiều nắng mực sẽ khô lại ( sản phẩm như hình )</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2996629854679_9427263a91ba86e36c338fa74d440b1d_ca51cd858e424540be78cd8524eadff1_grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z2957036866327_7a50b634618ad31cad9b38634f936b26__3___1__c5d2ed2719d34acdb2436b2ebaeb4df1_grande.png\"></p><p>Mực khô bảo quản 18 độ C hoặc ngăn mát tủ lạnh đều ngon. Thích hợp cho những buổi tiệc, họp mặt cuối tuần làm vài món nướng.</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2957036866327_7a50b634618ad31cad9b38634f936b26__3___1___1__a3317ba4d8d5443f804cdb311a10ebc7_grande.png\"></p>', 1, 64),
(65, 'Chả Mực Hạ Long', 5, 1, 'img\\product\\1649392106.webp', 'img/product/test/yLMWuL01jrVZQ48MDJJyU3p99i9lDg19DCyYzZNl.webp img/product/test/mXOvgfxUbAJ3xOUR2qTKsuuQu5ReRIEQ6W5lDydf.webp ', '<h2><strong>CHẢ MỰC HẠ LONG</strong></h2><p><strong>Chả Mực</strong> là món ngon truyền thống của người dân&nbsp;Hạ Long trong suốt hàng trăm năm qua. Được chế biến bởi người Hạ Long chính gốc trên cơ sở am hiểu, kế thừa những nét tinh túy trong nghệ thuật chế biến truyền thống.&nbsp;</p><p>Đặc biệt hơn Chả được giã bằng tay thủ công bí quyết tạo nên độ dai, sánh quyện của mực</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/cha-muc-ha-long__13__5967a4b822f54e7bafd741a18b722334_grande.jpg\" alt=\"cha-muc-ha-long\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/cha-muc-ha-long-3_3af7487b151e4709b8e04aaca34eb147_grande.jpg\" alt=\"cha-muc-ha-long-chien-gion\"></p><p><strong>Chả mực</strong> chiên giòn</p><p><img src=\"https://file.hstatic.net/1000030244/file/cha-muc-ha-long__3__5c86f995063b4faeb069d4857d34b7e2_grande.jpg\" alt=\"cha-muc-ha-long\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/93617553_2739496939451888_7602806908147204096_o_1aa26ba1f1e3425fa4c18c7e11a08096_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/94144599_2739496889451893_7785438774523068416_o_7d780540c406467f9c663b2be9518a5e_grande.jpg\"></p><p>Chấm tương ớt sẽ càng dậy mùi thơm của mực</p><p>Xôi&nbsp;trắng ăn kèm <strong>chả mực</strong> là đặc sản Quảng Ninh</p><p><img src=\"https://file.hstatic.net/1000030244/file/cha-muc-ha-long__11__27d9e38146ca43d38b471e6d7011c01c_grande.jpg\" alt=\"cha-muc-ha-long\"></p><p><strong>Chả mực</strong> cũng là món ăn chính trong bữa ăn gia đình.</p><p><img src=\"https://file.hstatic.net/1000030244/file/cha-muc-ha-long-2_0c0d20b84e034e078a55151eaf764c1c_grande.jpg\" alt=\"cha-muc-ha-long-chien-gion\"></p><p><strong>Chả mực</strong> chấm nước mắm tỏi ớt rất dậy mùi</p><p><img src=\"https://file.hstatic.net/1000030244/file/cha-muc-ha-long__12__bf02eacf69084c9d86d423912e189621_grande.jpg\" alt=\"cha-muc-ha-long\"></p><p>Bánh ướt ăn kèm với&nbsp;<strong>Chả mực </strong>ngon hết sảy</p><p>Hoặc dùng thành bữa chính trong bữa ăn rât hợp</p><p><img src=\"https://file.hstatic.net/1000030244/file/2_716e93682d7b44398d2940ec28982f72_grande.jpg\"></p>', 1, 65),
(66, 'Mực Lá Câu', 5, 2, 'img\\product\\1649391600.webp', 'img/product/test/NuHuo1URjyxtRIqolCafvjth96xqNalXpK6oiVVT.webp img/product/test/AUfdiYSQ0DQpv8bwRDjQtj4wQ9TO6niiENqrqaUE.webp ', '<p>Đảo Hải Sản cung cấp <strong>mực lá</strong> tươi cấp đông tại tàu ngay sau khi đánh bắt, giúp giữ nguyên độ tươi ngon và dinh&nbsp;dưỡng của mực , nhiều quy cách dễ dàng lựa chọn. Cam kết chất lượng tươi ngon, sạch 100% từ thiên nhiên.</p><p><img src=\"https://file.hstatic.net/1000030244/file/023__1__ae9813594bae4efeb9c4b5f02baee919_grande.png\" alt=\"muc-la\"></p><p>Mực lá đang bán tại shop đợt này size tầm 500gr - dưới 1kg/ con . Mực khách mua về rã đông và bắt đầu chế biến&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/023__5__16d6e91a70474406acdc7527fe47306d_grande.png\" alt=\"muc-la\"></p><p>Mực lá bán chạy vào những dịp lễ , cuối tuần , tất niên...khách mua biếu tặng rất nhiều vì hải sản không những ăn ngon mà còn giàu dinh dưỡng , mang nhiều sức khỏe tốt cho mọi gia đình</p><p><img src=\"https://file.hstatic.net/1000030244/file/023__7__b25f73d6c1c646fb8a0bfc26c3c414b1_grande.png\" alt=\"muc-la\"></p><p>&nbsp;</p><p>Gọi lá mực lá vì mực có hình dáng tựa như chiếc lá , tròn và dài. Mực lá được bán ra giá tầm 390.000đ/kg ( giá thay đổi theo mùa) . Thịt mực dày , săn dai và ngọt từng sớ thịt</p><p><img src=\"https://file.hstatic.net/1000030244/file/023__8__7de22a94409c4f11a1373fea0e31b978_grande.png\" alt=\"muc-la\"></p><p>Mực lá nhiều nhà dân hay xẻ và phơi qua 1 nắng , 2 nắng hay làm khô mực , mực tẩm ướp đều ngon và hấp dẫn. Ngoài ra mực lá làm nhiều món nướng , hấp hành gừng , xào rau củ hay rim me...</p><p><img src=\"https://file.hstatic.net/1000030244/file/l___12__grande.png\"></p><p>Mực lá nướng hấp dẫn từ màu sắc, hương thơm lan tỏa.Từng sớ thịt săn dai</p><p><img src=\"https://file.hstatic.net/1000030244/file/l___3__grande.png\"></p><p>Mực mua về tẩm ướp gia vị và cho vào lò nướng tầm khoảng 10-15 phút , sau đó cắt nhỏ và thưởng thức</p><p><img src=\"https://file.hstatic.net/1000030244/file/l___14__grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/l___9__grande.png\"></p><p>Chấm kèm tương ớt sẽ ngon hơn . Mực lá thích hợp cho nhiều buổi tiệc liên hoan công ty, sinh nhật hay bạn bè gặp mặt cuối tuần tụ họp . Ngồi lai rai nhấm nhấp và uống chung với bia càng tuyệt vời</p><p><img src=\"https://file.hstatic.net/1000030244/file/023__6__755345b2b96448f3b84b3f42c2d71c0d_grande.png\" alt=\"muc-la\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/l___2__grande.png\"></p>', 1, 66),
(67, 'Mực Ống Size S', 5, 4, 'img\\product\\1649391560.webp', 'img/product/test/WM7DK4kahKJQhLkqLt9JeYZr0eiUryNleonS7sYp.webp img/product/test/Nfwd7G3kv9ZFF5JSwN3B95sMIY6MhGvKqzDDX3aY.webp ', '<p><strong>Mực ống</strong> là loại ngon nhất trong họ hàng nhà mực. Mực là thực phẩm chứa nhiều dưỡng chất, có thể chế biến thành những món ăn ngon miệng. Trong ăn uống, ngoài việc chọn món ăn ngon, dễ chế biến thì bạn cũng nên chú ý đến những lợi ích sức khỏe mà món ăn sẽ mang lại.<strong>Mực ống</strong> sau khi đang bắt lên tàu được cấp đông ngay và mang vào bờ . Vì vậy từng con mực luôn tươi và vẫn giữ màu đẹp . Từng sớ thịt săn chắc , dày cơm ăn ngọt và béo</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/36287217_1936983803081506_7360103799513415680_o_3cc150bbc86e4aa6874d908fd3999695_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/67f2abe239e6cfb896f7_15d80515946d4bd49a9e1c59f6bc5891_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/ong_nho_vuong_grande.jpg\"></p><p><i>Mực ống </i>là loại hải sản có thân cuộn tròn (hình ống), hơi dài, mình mỏng thường dùng làm nguyên liệu cho nhiều món ăn ngon. Món mực ống nhỏ đang được nhiều người ưa thích.</p><p><img src=\"https://file.hstatic.net/1000030244/file/_dsff_d53497d266064ad6bdf872c016486fa1_grande.jpg\"></p><p>Gợi ý một vài món ngon \'\'kinh điển\'\' từ mực ống tươi ngon :&nbsp;</p><p>Mực hấp đơn giản dễ làm tại nhà.<strong>&nbsp;</strong></p><p><img src=\"https://file.hstatic.net/1000030244/file/_dsff_a1b9e045924649158932905edb4fb2f5_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/_dsff_50950d276ecd42fbba9a922b1398d5e6_grande.jpg\"></p><p>Mực chiên giòn thơm lừng đổi gió cho cả gia đình.</p><p><img src=\"https://file.hstatic.net/1000030244/file/mut-trung-chien-sao-ngonjjjjjjjjjj_grande.jpg\"></p><p>Mực ram mặn dùng chung với cơm siêu ngon.</p><p><img src=\"https://file.hstatic.net/1000030244/file/jjjjjjjjjjjjjjjjjjjjj_grande.jpg\"></p>', 1, 67),
(68, 'Bánh Xếp Nhân Mực', 5, 4, 'img\\product\\1649391494.webp', 'img/product/test/GkiFpsvZsGc0euDmRT2o0sLv43VURQh8kl4gjO0i.webp img/product/test/eEPCZXoJKnZfuOUCe6K9FqURd9gychUcNWpWZ8QY.webp ', '<p>Bánh xếp tôm mực&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2346371952289_3d63veved61737a126dcbf477a6d0bb694_d4695fc0883f40a5a21c9d60f07a5227_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z2346372079586_0v1a4avc638bf18c8794c02263314a3caa_be4951f80ad64746ac9d61ff5f341097_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z2v346373051249_4728e5fb37aa0b317aa9d88e63fba2df_3a46139e40784266879e1f9be7e1eba0_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z2346373357732_8a7vb4a8a33484bc37672e955ad6c5c4f_eed8b7dfa49e4adaa834ae239aff14b4_grande.jpg\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/z2346373401766_956v821de2f43b0607da382e0cea09b11_4d3c2b2240864252a3303b96408cee5f_grande.jpg\"></p>', 1, 68),
(69, 'Mực Ống Size L', 5, 5, 'img\\product\\1653293333.webp', 'img/product/test/lkKRkgGqDbOQ1bdyYdxEXZOy55YwHLUWWb9dz3xT.webp img/product/test/KuyeJ5qLfRQjgJVouJLonU5EUSD9XhEyJcMtwrtN.webp ', '<p>Đảo Hải Sản cung cấp mực tươi cấp đông tại tàu ngay sau khi đánh bắt, giúp giữ nguyên độ tươi ngon và dinh dưỡng của mực , nhiều quy cách dễ dàng lựa chọn. Cam kết chất lượng tươi ngon, sạch 100% từ thiên nhiên.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/muc__10__7a55d3a7738841209da851b9a8d1f0d9_grande.png\" alt=\"muc - ong - size L\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/muc__9__fad7670231d140dcb3fdc71208796a16_grande.png\" alt=\"muc - ong - size L\"></p><p>&nbsp;</p><p><strong>Mực ống</strong> có thể làm quà biếu tặng cho người thân , bạn bè bởi vì khi thưởng thức hải sản biển này có thể nhớ lại hương vị đậm đà miền trung cho những người con xa xứ , khách du lịch đã ăn qua.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/muc__12__f3290a3dec124add944f0eeaf42872d7_grande.png\" alt=\"muc - ong - size L\"></p><p>&nbsp;</p><p>Điểm danh một số món ăn ngon từ mực ống lớn hấp dẫn , nếu thích ăn mực thì đừng nên bỏ qua 5 món ăn như :</p><p><i><strong>Mực ống lớn nướng</strong></i></p><p><img src=\"https://file.hstatic.net/1000030244/file/m_c__25__grande.png\"></p><p>Wow ! <strong>Mực ống</strong> lớn mà nướng thì khổi chê từ màu sắc, hương thơm . Từng sớ thịt săn lại ăn ngọt và đậm đà . Nước sốt cũng góp phần tạo nên món mực ống nước thêm hấp dẫn và ngon miệng</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/m_c__23__grande.png\"></p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000030244/file/m_c__16__grande.png\"></p><p>Canh nướng mực trong vòng 5 phút , mực co và săn lại, da mực chuyển màu lúc đó gắp mực ra thưởng thức.</p><p><img src=\"https://file.hstatic.net/1000030244/file/m_c__10__grande.png\"></p><p><img src=\"https://file.hstatic.net/1000030244/file/m_c__12__grande.png\"></p><p><i><strong>Mực ốnglớn hấp&nbsp;</strong></i></p><p><br>&nbsp;</p>', 1, 69),
