(86, 'Pizza Hải Sản', 7, 4, 'img\\product\\1654787278.webp', NULL, '<p><strong>Pizza Hải Sản - Tôm</strong></p><p>(Ngon như nhà hàng - Thơm lan tỏa)</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2855543532168_e6a2b70667f11339d5c24a0ddb3be642__2__ce33edca52ac4897b503d9d5af0f7873_grande.png\"></p><p>Trọng lượng 180g/ cái đóng hộp gọn gàng và tiện lợi. Nếu chưa dùng thì bảo quản ngăn đông tủ lạnh. Ăn ngon như nhà hàng với hương vị thơm ngon và đầy đủ topping hải sản hấp dẫn.</p><p><img src=\"https://file.hstatic.net/1000030244/file/200014546_3092630527528378_7465683114054975645_n_e57ff34a73f3409e9f49ab8b33263a1c_grande.png\"></p><p>- Thành phần : Bột mì, tôm, mực, thanh cua, phô mai, Mozzarella và các gia vị khác.</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2855543532168_e6a2b70667f11339d5c24a0ddb3be642__1__da13397fdb8d452d94c06c30d41d9f77_grande.png\"></p><p>Mua về làm nóng lại bằng lò vi sóng hoặc cho vào chảo chống dính đảo qua lại là dùng được ngay</p><p><img src=\"https://file.hstatic.net/1000030244/file/z2855543532168_e6a2b70667f11339d5c24a0ddb3be642__4__5b74e97292984dcfb12d6dafa36b5284_grande.png\"></p>', 1, 86);
